  csrx_config: |
    interfaces {
    ge-0/0/0 {
        unit 0 {
            family inet {
                address 192.168.31.1/24;
            }
        }
    }
    ge-0/0/1 {
        unit 0 {
            family inet {
                address 192.168.33.1/24;
            }
        }
    }
    }
    security {
        policies {
            from-zone trust to-zone untrust {
                policy permit-ping-iperf {
                    match {
                        source-address any;
                        destination-address any;
                        application [ junos-ping iperf ];
                    }
                    then {
                        permit;
                    }
                }
            }
        }
        zones {
            security-zone trust {
                host-inbound-traffic {
                    system-services {
                        all;
                    }
                    protocols {
                        all;
                    }
                }
                interfaces {
                    ge-0/0/0.0;
                }
            }
            security-zone untrust {
                host-inbound-traffic {
                    system-services {
                        all;
                    }
                    protocols {
                        all;
                    }
                }
                interfaces {
                    ge-0/0/1.0;
                }
            }
        }
    }
    applications {
        application iperf {
            protocol tcp;
            destination-port 5001;
        }
    }
